import React from 'react';
import { Text, View } from 'react-native';
import { useSelector } from 'react-redux';

const BookMark = () => {
    useSelector(state => console.log(state))
    return (
        <View>
            <Text>Hello This is bookmark page</Text>
        </View>
    );
};

export default BookMark;
